from sympy import prime, primerange
def a(n):
    p = prime(n)
    s = sum(primerange(1, p))
    return int("".join(map(str, primerange(prime(s+1), prime(s+p)+1))))
print([a(n) for n in range(1, 10)]) # _Michael S. Branicky_, Dec 30 2025

